function jsPrint()
{

   // Your function code here
    console.log('printjs function execution Start!');
	var date = new Date();
  var dd = String(date.getDate()).padStart(2, '0');
  var mm = String(date.getMonth() + 1).padStart(2, '0');
  var yyyy = date.getFullYear();
  date = mm + '/' + dd + '/' + yyyy;

  // Fecthing values from player
  //var player = GetPlayer();
 var name = prompt("Please enter your name:", "");
if (!name) {
     var name = prompt("Please enter your name:", "");
}
  var course_title = "Nusring Management";
  var sign = "N R Z Malik";

  // Creating Document
  var doc = new jsPDF({
    orientation: 'landscape'
  });
//Adding Image
var imgData = 'data:image/jpeg;base64,';
        doc.addImage(imgData, 0, 0, 297, 210);
  // Font
  doc.setFontSize(28);
  doc.setFont('Times-Roman', 'bold');
  doc.setTextColor(0, 0, 0);

  // Writing
  var pageWidth = doc.internal.pageSize.getWidth();
  var nameWidth = doc.getStringUnitWidth(name) * doc.internal.getFontSize() / doc.internal.scaleFactor;
  var xPos = (pageWidth - nameWidth) / 2;
  doc.text(name, xPos, 100, null, null, 'left');

  // Font
  doc.setFontSize(14);
  doc.setTextColor(0, 0, 0);

  // Writing
  nameWidth = doc.getStringUnitWidth(course_title) * doc.internal.getFontSize() / doc.internal.scaleFactor;
  xPos = (pageWidth - nameWidth) / 2;
  doc.text(course_title, xPos, 133, null, null, 'left');
  doc.text(sign, 190, 153, null, null, 'left');
  doc.text(date, 73, 153, null, null, 'left');

  // Printing
  doc.save(name + " Certificate.pdf");
   console.log('printjs function execution Complete');


}